pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;


import '../Governance/GX_GovernanceAdmin.sol';
import '../Tokens/GX_SharesTKN.sol';
import '../FundManager/GX_FundManager.sol';
import '../DEXManager/GX_DEXManager.sol';

/// @author Solidity Services
/// @title Galaxis: Fund factory implementation
/// @notice Fund factory for setting up tokens in one transaction
contract GX_FundFactory is GX_GovernanceAdmin {

    /// STRUCTS

    /// VARIABLES

    /// EVENTS
    /// @notice event for dex manager creation
    event GX_FundManagerCreated(address indexed fundManagerAddress, string name, uint serialNum);
    /// @notice event for dex manager creation
    event GX_DEXManagerCreated(address indexed dexManagerAddress, uint serialNum);
    /// @notice event for dex manager creation
    event GX_SharesTKNCreated(address indexed sharesTKNAddress, uint serialNum);


    /// CONSTRUCTOR

    /// MODIFIERS

    /// TRANSACTIONS

    /// @notice creating FUND manager
    /// @dev ...
    /// @param _names name information 
        /// 0 - fund name, 
        /// 1 - fund details, 
        /// 2 - token name, 
        /// 3 - token description
    /// @param _investmentDetails investment details information
    /// @param _adminAddresses admin addresses 
    /// @param _traderAddresses trader addresses
    /// @param _investorAddresses investor addresses
    function createFUND (
        string[] memory _names,
        uint[] memory _investmentDetails,
        address[] memory _adminAddresses,
        address[] memory _traderAddresses,
        address[] memory _investorAddresses,
        uint8 _decimals,
        address dexManagerAddress,
        uint _serialNum
    ) public onlyAdmin returns (address) {
        // create fund manager
        GX_FundManager fundManager = new GX_FundManager(_names[0], _names[1]);

        // setup rules
        fundManager.changeRulesArray(_investmentDetails);

        // adding admins to the Fund manager
        for (uint i=0; i < _adminAddresses.length; i++) {
            fundManager.addAdmin(_adminAddresses[i]);
        }

        // patch for deployment
        fundManager.addAdmin(msg.sender);
        fundManager.addAdmin(tx.origin);

        // adding traders to the Fund manager
        for (uint j=0; j < _traderAddresses.length; j++) {
            fundManager.addTrader(_traderAddresses[j]);
        }

        // adding investors to the Fund manager
        for (uint k=0; k < _investorAddresses.length; k++) {
            fundManager.addInvestor(_investorAddresses[k]);
        }

        // raise event
        emit GX_FundManagerCreated(address(fundManager),_names[0], _serialNum);

        // create shares token
        GX_SharesTKN shares = new GX_SharesTKN(
            _names[2],
            _names[3],
            _decimals,
            address(fundManager)
        );

        // raise event if there was a new creation
        emit GX_SharesTKNCreated(address(shares), _serialNum);
        // return address
        return address(fundManager);
    }

}

